To fix a build error:

/home/xxxxxxxxxxxxx/onnxruntime/build/Linux/Debug/tensorboard/compat/proto/cost_graph.pb.cc:17:8: error: ‘PROTOBUF_INTERNAL_EXPORT_tensorboard_2fcompat_2fproto_2ftensor_5fshape_2eproto’ does not name a type
   17 | extern PROTOBUF_INTERNAL_EXPORT_tensorboard_2fcompat_2fproto_2ftensor_5fshape_2eproto ::PROTOBUF_NAMESPACE_ID::internal::SCCInfo<1> scc_info_TensorShapeProto_tensorboard_2fcompat_2fproto_2ftensor_5fshape_2eproto;

### Describe the issue

When running several models using just the CUDA EP everything works as expected. However when adding TensorRT as an EP my code seg faults. Debugger shows that the error happens with some JIT code that is being called with the following line: ```  ThrowOnError(GetApi().Run(this->p_, run_options, input_names, ort_input_values, input_count, output_names, output_count, ort_output_values));``` in ```onnxruntime_cxx_inline.h```.

Tested with a DeepLabV3Plus and Yolov4 network, both give same results. 
EP's are setup as follows in code:
```c++
Ort::SessionOptions sessionOptions;

int device_id = 0;

OrtTensorRTProviderOptions tensorRT_options{};
tensorRT_options.device_id = device_id;
tensorRT_options.trt_max_partition_iterations = 10;
tensorRT_options.trt_min_subgraph_size        = 5;
tensorRT_options.trt_max_workspace_size       = 2147483648;
tensorRT_options.trt_dump_subgraphs      = 1;
sessionOptions.AppendExecutionProvider_TensorRT(tensorRT_options);

OrtCUDAProviderOptions cuda_options{};
cuda_options.device_id = device_id;
sessionOptions.AppendExecutionProvider_CUDA(cuda_options);

session_ = Ort::Session(env, onnxFilePath.c_str(), sessionOptions);
```

### To reproduce

Build onnxruntime on Jetson Orin Dev Kit with the following command:
```
./build.sh --config Release --update --build --parallel --build_shared_lib --use_tensorrt --cuda_home /usr/local/cuda-11.4 --cudnn_home /usr/lib/aarch64-linux-gnu --tensorrt_home /usr/lib/aarch64-linux-gnu
```
Run model with TensorRT EP as described above

